  (18,62,'Send request for Site Survey','Fyi\r\n\r\n---------------------------- Original Message ----------------------------\r\nSubject: RE: [Fwd: PO. 004/VS-DI/PO-NA/I/09]-tambahan\r\nFrom:    \"Handlee Susanto\" <Handlee.Susanto@metrodata.co.id>\r\nDate:    Tue, February 3, 2009 1:42 pm\r\nTo:      \"NaNa\" <nana@arsena.co.id>\r\n--------------------------------------------------------------------------\r\n\r\nNa,\r\nTim Mover ini maksudnya apa yah? Yg akan melakukan delivery?\r\n\r\nUntuk ETA pengiriman ini yah\r\n1. Barang Storage XP24000 & Rack cabinet + Accesoriesnya akan masuk ke\r\nindonesia tanggal 05 February dan akan diproses bea cukai\r\n2. Barang Server Blade + accessoriesnya akan masuk ke Indonesia tanggal 12\r\nFebruary dan akan di proses bea cukai\r\n\r\nETA masuk ke BGR ada 1 minggu yah dari mulai masuk proses bea cukai\r\n\r\n\r\nThanks & Regards,\r\nHandlee Susanto\r\nHP TSG GENERAL MANAGER\r\nPh. 081905030062\r\nHandlee.Susanto@metrodata.co.id\r\nYM. Cienlee178\r\n\r\n\r\n-----Original Message-----\r\nFrom: NaNa [mailto:nana@arsena.co.id]\r\nSent: Tuesday, February 03, 2009 12:48 PM\r\nTo: Handlee Susanto\r\nSubject: [Fwd: PO. 004/VS-DI/PO-NA/I/09]-tambahan\r\n\r\nPak Handlee,\r\nTambahan pak.\r\nKarena masuk Telkomsel kita perlu SPK, Kami minta nama2 tim mover\r\nmetrodata untuk dimasukkan ke SPK.\r\n\r\nTerima kasih,\r\n\r\nBest regards,\r\n\r\nNana\r\n\r\n---------------------------- Original Message ----------------------------\r\nSubject: PO. 004/VS-DI/PO-NA/I/09\r\nFrom:    \"NaNa\" <nana@arsena.co.id>\r\nDate:    Tue, February 3, 2009 12:27 pm\r\nTo:      handlee.susanto@metrodata.co.id\r\nCc:      dwi@arsena.co.id\r\n--------------------------------------------------------------------------\r\n\r\nPak Handlee,\r\nMinta tolong dibantu update pengiriman PO no. 004/VS-DI/PO-NA/I/09.\r\n\r\nTerima kasih,\r\n\r\nBest regards,\r\n\r\nNana\r\nArsena Solusindo\r\n\r\n\r\n',2,0,'2009-02-03 20:35:44','',0,0,NULL),
