  (27,69,'XP24000 Storage H/W Delivery','Utk goods delivery hari ini saya bolak balik komunikasi dgn Metrodata dan CVG :\r\n\r\n  1. Menurut Henri MeB semua hutang Arsena sudah dibayar. Jadi so far (sekali lagi so far) no issue di finance. Dia bilang selama ini di MeB, Arsena punya bad record. That perhaps explain why some of their PIC seems avoid ketika di coba di hubungi.\r\n\r\n  2. Storage tetap akan hadir di gudang MeB hari Jumat pagi. Dan butuh internal process di MeB sekurang2nya 1/2 hari (ngeluarin dari container, \"nembak\" tiap items dgn barcode, dpt konfirmasi dari bagian finance, dsb). Jadi Henri ga confident kalau bisa dideliver on the same day. Di saat yg bersamaan CVG ngepush keras melalui saya agar barang tetap bisa diantar di hari Jumatnya, jadi kita bisa menggunakan akhir pekan utk kerja\r\n\r\n  3. Saya sudah minta pak Iqbal HP untuk membantu mem''push'' MeB agar storage, dan utamanya server nanti agar bisa di deliver ke TSEL hari Jumat\r\n\r\n  4. CVG minta agar kalau storage memang harus diantar hari Senin, utk Servers mestinya bisa jadi jumat di minggu depannya (dan tidak hari Senin). Karena mestinya supplier sudah belajar utk mempercepat proses. Hal ini sudah saya kemukakan baik ke MeB (via Henri) maupun melalui pak Iqbal HP. No HP Handlee tetap belum bisa dihubungi\r\n\r\n  5. CVG juga minta agar kita bisa menjelaskan sedikit business process di level custom clearance. Sebab mereka harus jelaskan ke PMO nya, mengapa bisa yakin kalau Jumat sudah bisa release dari bea cukai. Apakah berarti hanya tinggal menunggu ttd dari orang tertentu dari kamis sorenya, atau memang ada tanggal target selesai yang diberi custom dsb.\r\n\r\n  These whole things are part of the control from PMO.\r\n\r\n  lery\r\n',2,0,'2009-02-11 17:18:30','',0,0,NULL),
