  (95,81,'Acceptance and Approval','1. Tuesday and Wednesday CVG will do the application functionality test through VPN w/ Telkomsel\r\n2. Therefore, nobody should touch any machines, n/w and storage, either physically nor remotely\r\n3. The missing RJ 45 module component is going to be installed on Friday 27 March 2009\r\n4. Visitek Engineer will standby at Buaran for Tuesday 24 March and Wednesday 25 March to give on Site support during Application functionality test\r\nUAT Storage although has been done with Logica, most probably will be conducted again in front of TSEL, which most likely PIC is pak Asep. Can be either Wednesday or Friday. Storage team should be ready on one of that day\r\n5. We must share logs from IML and figure out the reason why NFS was down last weekend\r\n6. We must immediately find out the reason, and also resolve issue why Windows Storage Server on AIO1200R was ''crashed'' yesterday\r\n7. Command View Advance Edition (CVAE) must placed on separated h/w of the storage it selves. Our plan is to place this on one of the hard disk of DL through new IP on segment 118 with extra NIC still inside Testing Room \r\n8. We need additional 5 IPs on segment 118, 2 for San Switches and 2 for Cisco Catalyst (since the last 2 are conflict with Sun boxes of Logica), and 1 IP on segment 118 on DL for the purpose of Installating CVAE\r\n9. Pak Herry/Bujar will send latest version of LUN Configuration to Steve and he will share it to TSEL. \r\n10. After the activity of Application Functionality test is done, as TSEL require, Visitek must align the OS security setting and configuration, as TSEL standard. \r\n',17,0,'2009-03-24 11:26:19','',0,0,NULL),
