  (47,'Aanwjzing di BNI SAN Brocade (reschedule)',47,0,7,2,'2008-11-04 14:00:00',1,1,0,'2008-11-04 15:00:00',0,0,100,'Pak Arthur \r\n Aanwjzing di BNI untuk pengadaan San Switch Brocade :\r\n            Hari / Tanggal         : Kamis 30 Oktober 2008\r\n            Jam                        : 14.00\r\n            Tempat                   : Div Umum BNI jl Melawai Blk M\r\n*** Peserta,   PT Arsena\r\n                    PT  Berca\r\n                    PT Multipolar\r\nntuk SAN Switch Brocade M 24 kalau memang yang di maksud secara teknis\r\nadalah seperti di bawah ini Product Brocade nya adalah Brocade 300 Switch\r\n\r\n\r\nFibre Channel ports \r\n\r\n*\tSwitch mode (default): 24 ports in 8-port increments through Ports\r\non Demand licenses at 8, 16, and 24 universal (E, F, M, FL, or N) ports\r\n*\tAccess Gateway Default Port Mapping: 16 F_Ports, 8 N_Ports\r\n\r\n\r\nDan untuk yang M 32 dan M48 nama product nya adalah Brocade 5000 Switch\r\n\r\n\r\nFibre Channel ports\r\n32 ports, universal (E, F, M, and FL)\r\n\r\n\r\nSystems Architecture\r\n\r\nFibre Channel ports \r\n\r\n*\t64 ports, universal (E, F, and FL)\r\n\r\n\r\nBrocade 4900 Switch\r\n\r\n\r\n \r\n\r\n                   \r\n\r\n \r\n\r\nTerima kasih\r\n\r\n \r\n\r\nArthur',0.00,'',2,0,0,0,0,1,'','',NULL,1,''),
